  false,\n\t\"url\": null,\n\t\"notes\": \"The McGregor District manages a relatively
  small farming program which utilizes Cooperative Agreements with local farmers.
  All fields are in an area of Clayton County, Iowa referred to as the Turkey River
  Bottoms and are across the Mississippi River from Cassville Wisconsin. These fields
  have historically been under cultivation before acquisition of the Refuge. The sole
  purpose of the Cropland Management Plan is to prevent the encroachment of woody
  vegetation into the fields until such time that moist soil units are developed.\",\n\t\"owner_org\":
